const Date = () => {
    let newDate = new Date()
    let date = newDate.getDate();
    let month = newDate.getMonth() + 1;
    let year = newDate.getFullYear();
    const separator = ''
    return `${year}${separator}${month < 10 ? `${month}` : `${month}`}${separator}${date} `
}

export default Date;
